import { useState } from "react";
import BasicInfoStep from "./registrationSteps/BasicInfoStep";

const RegistrationForm = () => {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    name: "", // Organization Name
    shortname: "", // Short Name (Abbreviation)
    description: "", // Short description
    address: "", // Office Address
    representation: "Main", // Default selection to "Main"
  });

  const nextStep = () => setStep(step + 1);
  const prevStep = () => setStep(step - 1);

  return (
    <div className="registration-container">
      {step === 1 && (
        <BasicInfoStep formData={formData} setFormData={setFormData} nextStep={nextStep} />
      )}

      {step > 1 && <button onClick={prevStep}>Back</button>}
    </div>
  );
};

export default RegistrationForm;
